create table city
(
    code            varchar(16)  not null
        primary key,
    country_code_id varchar(16)  null,
    eng_name        varchar(128) null,
    chn_name        varchar(128) null,
    time_zone       varchar(32)  null,
    description     longtext     null,
    is_delete       tinyint(1)   not null,
    create_datetime datetime(6)  not null,
    create_by       varchar(32)  not null,
    update_datetime datetime(6)  not null,
    update_by       varchar(32)  not null,
    constraint city_country_code_id_9bd15f2e_fk_country_code
        foreign key (country_code_id) references country (code)
);

create index city_create_datetime_408de1f9
    on city (create_datetime);

create index city_update_datetime_0801c5b8
    on city (update_datetime);

